import React, { Component } from 'react';

class AdminBodyAdd extends Component {
    render() {
        return (
            <div className="admin-body">
                <h1>Ajouter un chat</h1>
                <i class="material-icons" style={{fontSize:"200px"}}>account_circle</i>
                <div>
                <input name="name" placeholder='Nom du chat'></input>
                </div>
                <div>
                <input name="birthdate" placeholder='Date de Naissance'></input>
                </div>
                <div>
                <input name="race" placeholder='Race'></input>
                </div>
                <div>
                <input name="sexe" placeholder='Sexe'></input>
                </div>
                <div>
                <input name="ville" placeholder='Ville'></input>
                </div>
                <div>
                <input name="description" placeholder='Description'></input>
                </div>

            </div>
        );
    }
}

export default AdminBodyAdd;
